foreignObject.div:
dataSource : org.apache.tomcat.jdbc.pool.DataSource
destroy-method = close
driverClassName = ${database.driver}
url = ${database.url}
username = ${database.user}
password = ${database.password}
validationQuery = ${database.validationQuery}
testOnBorrow = true
minIdle = 20
maxIdle = 100
maxActive = 400
defaultTransactionIsolation = ${database.defaultTransactionOnIsolation}

mailSender : org.springframework.mail.javamail.JavaMailSenderImpl
host = ${email.smtp.host}
port = ${email.smtp.port}
username = ${email.smtp.username}
password = ${email.smtp.password}
javaMailProperties[mail.smtp.auth] = ${email.check.auth}
javaMailProperties[mail.smtp.starttls.enable] = ${email.use.tls}
